import ChatUserList from './ChatUserList';
import ChatMessageList from './ChatMessageList';
const ShowStuff = ({ stuff }) => {
let content = <ChatMessageList messageList = {stuff.messageList}/>;
  return (
    <div>
    Hello
    <ul>
      { Object.keys(stuff.userList).map( key => ( <li key={key}>{key}: {stuff.userList[key]}</li> ) ) }
    </ul>
    {content}
    </div>
  );
};
export default ShowStuff;
